import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { View, ScrollView } from 'react-native';
import { Button } from 'react-native-paper';
import { Icon } from 'react-native-vector-icons/Octicons';
import React from 'react';

function HomeNavigation() {
  return (
      <ScrollView style={{ marginTop: 50 }}>
          <View style={{ padding: '10%' }}>

              <View style={{ flexDirection: 'row', justifyContent: 'space-evenly' }}>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#b3abd1', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="person" size={80} color="black" />
                  </Button>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#b3abd1', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="calendar" size={80} color="black" />
                  </Button>

              </View>

              <View style={{ flexDirection: 'row', justifyContent: 'space-evenly' }}>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#cb5656', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="archive" size={80} color="black" />
                  </Button>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#cb5656', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="clock" size={80} color="black" />
                  </Button>

              </View>

              <View style={{ flexDirection: 'row', justifyContent: 'space-evenly' }}>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#829341', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="inbox" size={80} color="black" />
                  </Button>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#829341', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="pencil" size={80} color="black" />
                  </Button>

              </View>

              <View style={{ flexDirection: 'row', justifyContent: 'space-evenly' }}>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#d1dd4c', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="book" size={80} color="black" />
                  </Button>

                  <Button style={{ marginTop: '5%', width: '45%', height: 150, alignSelf: 'center', justifyContent: 'center', backgroundColor: '#d1dd4c', borderRadius: '15%' }} mode="contained" onPress={() => console.log('Pressed')}>
                      <Icon style={{ alignItems: 'center' }} name="broadcast" size={80} color="black" />
                  </Button>

              </View>

          </View>
      </ScrollView>
  );
}

const Stack = createStackNavigator();

export default function App() {

  return (

    <NavigationContainer>
      <Stack.Navigator initialRouteName='HomeNavigation'>
        <Stack.Screen name='HomeNavigation' component={HomeNavigation} />
      </Stack.Navigator>
    </NavigationContainer>

  );
}
